import React, {Component} from "react";

class MemoInput extends Component{
    constructor(props){
        super(props);
    }
    render(){
        console.log(this.props._memoContents);
        return(
            <input
                type = 'text'
                placeholder="add Memo!"
                onKeyDown={function(e){
                    if(e.nativeEvent.key === 'Enter'){
                        e.preventDefault();
                        var addMemo = e.target.value;
                        // console.log(addMemo);
                        this.props.callUpperUpdateFunc([this.props._memoContents,addMemo]);
                    }
                }}
            >
            </input>
        )
    }
}

export default MemoInput
